import {Stack, TextField } from '@mui/material';
import React from 'react';



function App() {
  return (
    <div>
      <Stack spacing={4}>
        <Stack direction='row' spacing={2}>
        <TextField

          label="Note Title"
          variant='outlined'
          color='primary'
          required

        />

        <TextField

          title='Peixe'
          label="Note Title"
          variant='outlined'
          color='primary'
          required
        />

      </Stack>
      </Stack>
    </div>

  );
}

export default App;
